import React, { useState } from 'react';
import {
  View,
  Text,
  TextInput,
  TouchableOpacity,
  StyleSheet,
  ScrollView,
} from 'react-native';
import { useNavigation } from '@react-navigation/native';

const Energia = () => {
  const navigation = useNavigation();
  const [itens, setItens] = useState([]);
  const [item, setItem] = useState('');
  const [potenciaNominal, setPotenciaNominal] = useState('');
  const [quantidade, setQuantidade] = useState('');
  const [horasUso, setHorasUso] = useState('');
  const [potenciaMinima, setPotenciaMinima] = useState('');

  const handleEnergia = () => {
    const potencia = potenciaNominal * quantidade;
    setItens([...itens, { item, potenciaNominal, quantidade, horasUso, potencia }]);
    const potenciaTotal = itens.reduce((total, item) => total + item.potencia, 0);
    setPotenciaMinima(`${potenciaTotal} Watts`);
  };

  const handleAdicionarItem = () => {
    handleEnergia();
    setItem('');
    setPotenciaNominal('');
    setQuantidade('');
    setHorasUso('');
  };

  return (
    <ScrollView contentContainerStyle={styles.container}>
      <Text style={styles.title}>
        Sistemas de reserva/integral de energia residencial/industrial (Onda pura):
        Itens de Consumo de Energia:
      </Text>
      <Text style={styles.texto2}>Digite a descrição do item:</Text>
      <TextInput
        style={styles.input}
        placeholder=""
        value={item}
        onChangeText={(text) => {
          setItem(text);
        }}
      />
      <Text style={styles.texto3}>Digite a potência Nominal (Watts):</Text>
      <TextInput
        style={styles.input}
        keyboardType="numeric"
        placeholder=""
        value={potenciaNominal}
        onChangeText={(text) => {
          setPotenciaNominal(text);
        }}
      />
      <Text style={styles.texto4}>Digite a Quantidade:</Text>
      <TextInput
        style={styles.input}
        keyboardType="numeric"
        placeholder=""
        value={quantidade}
        onChangeText={(text) => {
          setQuantidade(text);
        }}
      />
      <Text style={styles.texto6}>Digite as Horas de uso:</Text>
      <TextInput
        style={styles.input}
        keyboardType="numeric"
        placeholder=""
        value={horasUso}
        onChangeText={(text) => {
          setHorasUso(text);
        }}
      />
      <TouchableOpacity style={styles.button} onPress={handleAdicionarItem}>
        <Text style={styles.buttonText}>Adicionar outro item</Text>
      </TouchableOpacity>

      <Text style={styles.texto2}>Itens:</Text>
      {itens.map((item, index) => (
        <View key={index}>
          <Text style={styles.texto2}>
            {item.item} - {item.potenciaNominal} Watts - Quantidade: {item.quantidade} - Horas de uso: {item.horasUso}
          </Text>
        </View>
      ))}
      {resultadoEnergia ? (
        <Text style={styles.resultadoEnergia}>
          Potência mínima do inversor: {resultadoEnergia}
        </Text>
      ) : null}
    </ScrollView>
  );
};

const styles = StyleSheet.create({
  container: {
    flexGrow: 1,
    justifyContent: 'center',
    alignItems: 'center',
    padding: 16,
  },
  resultadoEnergia:{
    alignSelf: 'flex-start',
    justifyContent:'space-between',
    fontSize: 20,
    marginBottom: 10,
  },
  texto1: {
    alignSelf: 'flex-start',
    justifyContent: 'space-between',
    fontSize: 20,
    marginBottom: 10,
  },
  texto2: {
    alignSelf: 'flex-start',
    justifyContent: 'space-between',
    fontSize: 20,
    marginBottom: 10,
  },
  texto3: {
    alignSelf: 'flex-start',
    justifyContent: 'space-between',
    fontSize: 20,
    marginBottom: 10,
  },
  texto4: {
    alignSelf: 'flex-start',
    justifyContent: 'space-between',
    fontSize: 20,
    marginBottom: 10,
  },
  texto5: {
    alignSelf: 'flex-start',
    justifyContent: 'space-between',
    fontSize: 20,
    marginBottom: 10,
  },
  texto6: {
    alignSelf: 'flex-start',
    justifyContent: 'space-between',
    fontSize: 20,
    marginBottom: 10,
  },
    title: {
      alignSelf: 'flex-start',
      justifyContent:'space-between',
      fontSize: 30,
      fontWeight: 'bold',
      marginBottom: 24,
    },
    
    input: {
      width: '100%',
      height: 40,
      borderWidth: 1,
      borderColor: '#ccc',
      borderRadius: 8,
      paddingHorizontal: 16,
      marginBottom: 16,
    },
    button: {
      width: '100%',
      height: 70,
      backgroundColor: 'red',
      borderRadius: 8,
      justifyContent: 'center',
      alignItems: 'center',
    },
    buttonText: {
      fontSize: 20,
      fontWeight: 'bold',
      color: '#FFF',
    },
    button1: {
        width: '100%',
        height: 70,
        backgroundColor: 'red',
        borderRadius: 8,
        justifyContent: 'center',
        alignItems: 'center',
      },
      buttonText1: {
        fontSize: 20,
        fontWeight: 'bold',
        color: '#FFF',
      },
      button5: {
        width: '100%',
        height: 70,
        backgroundColor: 'red',
        borderRadius: 8,
        justifyContent: 'center',
        alignItems: 'center',
      },
  });
  
  export default Energia;
